app.factory("auth",["$http","$q","identity",function(t,n,u){return{login:function(n){return t.post("/login",n)},logout:function(){return t.post("/logout")},signUp:function(n){return t.post("/signup",n)},isAuthenticated:function(){if(u.isAuthenticated()){return true}else{return n.reject("not authorized")}}}}]);